      return fnany;
    };
    Vx.Core.Func_any_from_func fn_any = Vx.Core.vx_any_first_from_list_fn(
      Vx.Core.t_any_from_func,
      thenelselist,
      fnc
    );
    if (fn_any != Vx.Core.e_any_from_func) {
      output = fn_any.vx_any_from_func(generic_any_1);
    }
    return output;
